import React from 'react'
import './App.css'
import styled from 'styled-components'

const Title = styled.h1`
  color: red;
  font-size: 18px;
`

const Site = styled.div`
  width: 400px;
  height: 400px;
  background-color: green;
`


function App () {
  return(
    <Site>
      <Title>Titulo bem legal</Title>
    </Site>
  ) 
}

export default App
